INSERT INTO `peliculas` VALUES (1,'El Padrino',16.00,'Un clásico del cine dirigido por Francis Ford Coppola, que sigue la historia de la familia Corleone, una de las más poderosas de la mafia en Nueva York. Michael Corleone, el hijo menor, se ve obligado a tomar el control del negocio familiar.',_binary '','crimen'),(2,'Interestelar ',14.00,' Dirigida por Christopher Nolan, esta película de ciencia ficción sigue a un grupo de astronautas que viajan a través de un agujero de gusano en busca de un nuevo hogar para la humanidad, mientras el tiempo y el espacio juegan en su contra.',_binary '','ciencia ficcion'),(3,'El Conjuro ',11.00,'Basada en hechos reales, esta película de terror sigue a los investigadores paranormales Ed y Lorraine Warren mientras intentan ayudar a una familia aterrorizada por una presencia oscura en su casa.',_binary '','terror'),(4,'Titanic ',13.00,'Dirigida por James Cameron, esta película épica y romántica cuenta la trágica historia del hundimiento del Titanic a través del amor imposible entre Jack y Rose, dos jóvenes de diferentes clases sociales.',_binary '','drama'),(5,'up',13.00,'La historia sigue a Carl Fredricksen, un anciano viudo y gruñón que, tras la muerte de su esposa Ellie, decide cumplir su sueño de viajar a Cataratas del Paraíso en América del Sur. Para ello, ata miles de globos a su casa y la hace volar. Sin embargo, descubre demasiado tarde que accidentalmente se ha llevado a bordo a Russell, un niño explorador entusiasta pero torpe.\r\n\r\nDurante su aventura, Carl y Russell conocen a Dug, un perro con un collar que le permite hablar, y a Kevin, un colorido pájaro gigante. Juntos, se enfrentan al villano Charles Muntz, un explorador obsesionado con capturar a Kevin para restaurar su reputación.',_binary '','aventura');
INSERT INTO `peliculas` VALUES (6,'poltergeist ',8.00,'Son pocas las películas que han marcado un antes y después en la historia del cine de terror al grado de considerarse joyas clásicas. Las atmósferas de suspenso que engloban las historias trascienden la pantalla provocando que más de uno se sujete, hasta con las uñas, de su asiento, abrace a la persona que tiene a lado o presente insomnio a la hora de dormir mientras imagina que las horripilantes escenas se vuelven realidad.',_binary '','terror'),(11,'dragon ball',15.00,'La historia comienza con un vistazo al pasado del Planeta Vegeta, hogar de los Saiyajin. El Rey Vegeta descubre a un niño con un poder increíble, Broly, y lo destierra a un planeta remoto por considerarlo una amenaza al futuro de su hijo, el príncipe Vegeta. En paralelo, otro niño Saiyajin, Kakarotto (Goku), es enviado a la Tierra por sus padres para salvarlo de la destrucción inminente del planeta por parte de Freezer.\r\n\r\nDécadas después, en el presente, Goku y Vegeta se entrenan continuamente para enfrentar nuevas amenazas. Cuando Freezer regresa con un nuevo plan, descubre a Broly y lo lleva a la Tierra con la intención de usarlo como arma. Sin embargo, Broly, al desatar su poder sin control, se convierte en una fuerza devastadora que ni siquiera Goku y Vegeta pueden manejar fácilmente.',_binary '','animacion'),(12,'Star Wars: Episodio IV',9.00,'En el último episodio de la trilogía de precuelas, la República Galáctica está al borde del colapso tras años de guerra contra los separatistas. El joven caballero Jedi Anakin Skywalker lucha con visiones de la muerte de su esposa Padmé Amidala, mientras el Canciller Palpatine, que oculta su verdadera identidad como Lord Sith Darth Sidious, lo manipula para que se vuelva contra los Jedi.\r\n\r\nAtrapado entre su lealtad a Obi-Wan Kenobi, la Orden Jedi, y su creciente desesperación, Anakin cae finalmente al lado oscuro, convirtiéndose en Darth Vader. Esto desencadena la caída de la República, el ascenso del Imperio Galáctico y el trágico inicio de uno de los villanos más icónicos del cine.',_binary '','ciencia ficcion'),(13,'Deadpool (2016) ',10.00,'Wade Wilson es un exsoldado de las Fuerzas Especiales que trabaja como mercenario en Nueva York. Su vida da un giro inesperado cuando le diagnostican cáncer terminal. En busca de una cura, acepta participar en un experimento secreto que promete salvarle la vida y otorgarle habilidades sobrehumanas.\r\n\r\nEl experimento, realizado por una organización clandestina, lo deja desfigurado pero con un factor de curación acelerado similar al de Wolverine. Renacido como Deadpool, un antihéroe irreverente y sarcástico con un estilo único y una ruptura constante de la cuarta pared (habla directamente al espectador), Wade se embarca en una misión para vengarse de los responsables de su transformación, mientras intenta recuperar a su amor perdido, Vanessa.\r\n\r\n',_binary '','comedia');
/*!40000 ALTER TABLE `peliculas` ENABLE KEYS */;
