INSERT INTO `peliculas_historico` VALUES (1,'Spider-Man',10.00,'ciencia ficcion','Peter Parker es un estudiante tímido y brillante que vive con sus tíos en Nueva York. Su vida cambia por completo cuando es mordido por una araña genéticamente modificada y adquiere poderes sobrehumanos, como fuerza, agilidad y la capacidad de trepar paredes. Al principio, intenta usar sus habilidades para beneficio personal, pero tras la muerte de su querido tío Ben, comprende que \"un gran poder conlleva una gran responsabilidad\".\r\n\r\nConvertido en Spider-Man, Peter se dedica a proteger la ciudad del crimen, mientras enfrenta conflictos personales y románticos, especialmente con Mary Jane, su amor de toda la vida. Su mayor reto llega cuando debe enfrentarse al Duende Verde, un villano con fuerza y tecnología avanzada, que resulta ser el padre de su mejor amigo. La lucha entre el deber, la identidad secreta y los lazos personales marcarán el inicio de su camino como héroe.','2025-05-11',_binary ''),(2,'dragon ball',15.00,'animacion','La historia comienza con un vistazo al pasado del Planeta Vegeta, hogar de los Saiyajin. El Rey Vegeta descubre a un niño con un poder increíble, Broly, y lo destierra a un planeta remoto por considerarlo una amenaza al futuro de su hijo, el príncipe Vegeta. En paralelo, otro niño Saiyajin, Kakarotto (Goku), es enviado a la Tierra por sus padres para salvarlo de la destrucción inminente del planeta por parte de Freezer.\r\n\r\nDécadas después, en el presente, Goku y Vegeta se entrenan continuamente para enfrentar nuevas amenazas. Cuando Freezer regresa con un nuevo plan, descubre a Broly y lo lleva a la Tierra con la intención de usarlo como arma. Sin embargo, Broly, al desatar su poder sin control, se convierte en una fuerza devastadora que ni siquiera Goku y Vegeta pueden manejar fácilmente.','2025-05-19',_binary ''),(3,'Star Wars: Episodio IV',9.00,'ciencia ficcion','En el último episodio de la trilogía de precuelas, la República Galáctica está al borde del colapso tras años de guerra contra los separatistas. El joven caballero Jedi Anakin Skywalker lucha con visiones de la muerte de su esposa Padmé Amidala, mientras el Canciller Palpatine, que oculta su verdadera identidad como Lord Sith Darth Sidious, lo manipula para que se vuelva contra los Jedi.\r\n\r\nAtrapado entre su lealtad a Obi-Wan Kenobi, la Orden Jedi, y su creciente desesperación, Anakin cae finalmente al lado oscuro, convirtiéndose en Darth Vader. Esto desencadena la caída de la República, el ascenso del Imperio Galáctico y el trágico inicio de uno de los villanos más icónicos del cine.','2025-05-19',_binary ''),(4,'Deadpool (2016) ',10.00,'comedia','Wade Wilson es un exsoldado de las Fuerzas Especiales que trabaja como mercenario en Nueva York. Su vida da un giro inesperado cuando le diagnostican cáncer terminal. En busca de una cura, acepta participar en un experimento secreto que promete salvarle la vida y otorgarle habilidades sobrehumanas.\r\n\r\nEl experimento, realizado por una organización clandestina, lo deja desfigurado pero con un factor de curación acelerado similar al de Wolverine. Renacido como Deadpool, un antihéroe irreverente y sarcástico con un estilo único y una ruptura constante de la cuarta pared (habla directamente al espectador), Wade se embarca en una misión para vengarse de los responsables de su transformación, mientras intenta recuperar a su amor perdido, Vanessa.\r\n\r\n','2025-05-19',_binary '');
